using Rubin
using Tests
using Elliptic
using HypergeometricFunctions
using Polylogarithms
using SpecialFunctions

@test integrate(sec(c+d*x)^4*(a+a*sec(c+d*x)), x) == :(a*d^-1*tan(c+d*x)+1//3*a*d^-1*tan(c+d*x)^3+3//8*a*d^-1*arctanh(sin(c+d*x))+1//4*a*d^-1*sec(c+d*x)^3*tan(c+d*x)+3//8*a*d^-1*sec(c+d*x)*tan(c+d*x))
@test integrate(sec(c+d*x)^3*(a+a*sec(c+d*x)), x) == :(a*d^-1*tan(c+d*x)+(1/2)*a*d^-1*arctanh(sin(c+d*x))+1//3*a*d^-1*tan(c+d*x)^3+(1/2)*a*d^-1*sec(c+d*x)*tan(c+d*x))
@test integrate(sec(c+d*x)^2*(a+a*sec(c+d*x)), x) == :(a*d^-1*tan(c+d*x)+(1/2)*a*d^-1*arctanh(sin(c+d*x))+(1/2)*a*d^-1*sec(c+d*x)*tan(c+d*x))
@test integrate((a+a*sec(c+d*x))*sec(c+d*x), x) == :(a*d^-1*arctanh(sin(c+d*x))+a*d^-1*tan(c+d*x))
@test integrate(a+a*sec(c+d*x), x) == :(a*x+a*d^-1*arctanh(sin(c+d*x)))
@test integrate((a+a*sec(c+d*x))*cos(c+d*x), x) == :(a*x+a*d^-1*sin(c+d*x))
@test integrate(cos(c+d*x)^2*(a+a*sec(c+d*x)), x) == :((1/2)*a*x+a*d^-1*sin(c+d*x)+(1/2)*a*d^-1*cos(c+d*x)*sin(c+d*x))
@test integrate(cos(c+d*x)^3*(a+a*sec(c+d*x)), x) == :((1/2)*a*x+a*d^-1*sin(c+d*x)+-1//3*a*d^-1*sin(c+d*x)^3+(1/2)*a*d^-1*cos(c+d*x)*sin(c+d*x))
@test integrate(cos(c+d*x)^4*(a+a*sec(c+d*x)), x) == :(3//8*a*x+a*d^-1*sin(c+d*x)+-1//3*a*d^-1*sin(c+d*x)^3+1//4*a*d^-1*cos(c+d*x)^3*sin(c+d*x)+3//8*a*d^-1*cos(c+d*x)*sin(c+d*x))
@test integrate((a+a*sec(c+d*x))^2*sec(c+d*x)^4, x) == :(3//4*a^2*d^-1*arctanh(sin(c+d*x))+3//5*a^2*d^-1*tan(c+d*x)^3+9//5*a^2*d^-1*tan(c+d*x)+(1/2)*a^2*d^-1*sec(c+d*x)^3*tan(c+d*x)+1//5*a^2*d^-1*sec(c+d*x)^4*tan(c+d*x)+3//4*a^2*d^-1*sec(c+d*x)*tan(c+d*x))
@test integrate((a+a*sec(c+d*x))^2*sec(c+d*x)^3, x) == :(2*a^2*d^-1*tan(c+d*x)+2//3*a^2*d^-1*tan(c+d*x)^3+7//8*a^2*d^-1*arctanh(sin(c+d*x))+1//4*a^2*d^-1*sec(c+d*x)^3*tan(c+d*x)+7//8*a^2*d^-1*sec(c+d*x)*tan(c+d*x))
@test integrate((a+a*sec(c+d*x))^2*sec(c+d*x)^2, x) == :(a^2*d^-1*arctanh(sin(c+d*x))+5//3*a^2*d^-1*tan(c+d*x)+a^2*d^-1*sec(c+d*x)*tan(c+d*x)+1//3*a^2*d^-1*sec(c+d*x)^2*tan(c+d*x))
@test integrate((a+a*sec(c+d*x))^2*sec(c+d*x), x) == :(2*a^2*d^-1*tan(c+d*x)+3//2*a^2*d^-1*arctanh(sin(c+d*x))+(1/2)*a^2*d^-1*sec(c+d*x)*tan(c+d*x))
@test integrate((a+a*sec(c+d*x))^2, x) == :(x*a^2+a^2*d^-1*tan(c+d*x)+2*a^2*d^-1*arctanh(sin(c+d*x)))
@test integrate((a+a*sec(c+d*x))^2*cos(c+d*x), x) == :(2*x*a^2+a^2*d^-1*arctanh(sin(c+d*x))+a^2*d^-1*sin(c+d*x))
@test integrate((a+a*sec(c+d*x))^2*cos(c+d*x)^2, x) == :(3//2*x*a^2+2*a^2*d^-1*sin(c+d*x)+(1/2)*a^2*d^-1*cos(c+d*x)*sin(c+d*x))
@test integrate((a+a*sec(c+d*x))^2*cos(c+d*x)^3, x) == :(x*a^2+2*a^2*d^-1*sin(c+d*x)+-1//3*a^2*d^-1*sin(c+d*x)^3+a^2*d^-1*cos(c+d*x)*sin(c+d*x))
@test integrate((a+a*sec(c+d*x))^2*cos(c+d*x)^4, x) == :(7//8*x*a^2+2*a^2*d^-1*sin(c+d*x)+-2//3*a^2*d^-1*sin(c+d*x)^3+1//4*a^2*d^-1*cos(c+d*x)^3*sin(c+d*x)+7//8*a^2*d^-1*cos(c+d*x)*sin(c+d*x))
@test integrate((a+a*sec(c+d*x))^2*cos(c+d*x)^5, x) == :(3//4*x*a^2+-1*a^2*d^-1*sin(c+d*x)^3+2*a^2*d^-1*sin(c+d*x)+1//5*a^2*d^-1*sin(c+d*x)^5+(1/2)*a^2*d^-1*cos(c+d*x)^3*sin(c+d*x)+3//4*a^2*d^-1*cos(c+d*x)*sin(c+d*x))
@test integrate((a+a*sec(c+d*x))^3*sec(c+d*x)^3, x) == :(4*a^3*d^-1*tan(c+d*x)+1//5*a^3*d^-1*tan(c+d*x)^5+5//3*a^3*d^-1*tan(c+d*x)^3+13//8*a^3*d^-1*arctanh(sin(c+d*x))+3//4*a^3*d^-1*sec(c+d*x)^3*tan(c+d*x)+13//8*a^3*d^-1*sec(c+d*x)*tan(c+d*x))
@test integrate((a+a*sec(c+d*x))^3*sec(c+d*x)^2, x) == :(a^3*d^-1*tan(c+d*x)^3+4*a^3*d^-1*tan(c+d*x)+15//8*a^3*d^-1*arctanh(sin(c+d*x))+1//4*a^3*d^-1*sec(c+d*x)^3*tan(c+d*x)+15//8*a^3*d^-1*sec(c+d*x)*tan(c+d*x))
@test integrate((a+a*sec(c+d*x))^3*sec(c+d*x), x) == :(4*a^3*d^-1*tan(c+d*x)+1//3*a^3*d^-1*tan(c+d*x)^3+5//2*a^3*d^-1*arctanh(sin(c+d*x))+3//2*a^3*d^-1*sec(c+d*x)*tan(c+d*x))
