@test integrate((a+a*sec(c+d*x))^3*cos(c+d*x)^4, x) == :(15//8*x*a^3+-1*a^3*d^-1*sin(c+d*x)^3+4*a^3*d^-1*sin(c+d*x)+1//4*a^3*d^-1*cos(c+d*x)^3*sin(c+d*x)+15//8*a^3*d^-1*cos(c+d*x)*sin(c+d*x))
@test integrate((a+a*sec(c+d*x))^3*cos(c+d*x)^5, x) == :(13//8*x*a^3+4*a^3*d^-1*sin(c+d*x)+-5//3*a^3*d^-1*sin(c+d*x)^3+1//5*a^3*d^-1*sin(c+d*x)^5+3//4*a^3*d^-1*cos(c+d*x)^3*sin(c+d*x)+13//8*a^3*d^-1*cos(c+d*x)*sin(c+d*x))
