@test integrate((a+a*sec(c+d*x))^4*sec(c+d*x), x) == :(8*a^4*d^-1*tan(c+d*x)+4//3*a^4*d^-1*tan(c+d*x)^3+35//8*a^4*d^-1*arctanh(sin(c+d*x))+1//4*a^4*d^-1*sec(c+d*x)^3*tan(c+d*x)+27//8*a^4*d^-1*sec(c+d*x)*tan(c+d*x))
